function encryptString(pconnectionsWheel,
                       pconnectionsRotor1,
                       pconnectionsRotor2,
                       pconnectionsRotor3,
                       string,
                       prevConnecWheel,
                       prevConnec1,
                       prevConnec2,
                       prevConnec3,
                       pplugs,
                       protor1Rotation,
                       protor2Rotation,
                       protor3Rotation,
                       protor1RingSetting,
                       protor2RingSetting,
                       protor3RingSetting,
                       pdoAnomaly,
                       pconnectionsReflector,
                       pturnOverNotches1,
                       pturnOverNotches2
                       ){

    connectionsWheel = pconnectionsWheel.split(".");
    connectionsRotor1 = pconnectionsRotor1.split(".");
    connectionsRotor2 = pconnectionsRotor2.split(".");
    connectionsRotor3 = pconnectionsRotor3.split(".");
    revConnec1 = prevConnec1.split(".");
    revConnec2 = prevConnec2.split(".");
    revConnec3 = prevConnec3.split(".");
    revConnecWheel = prevConnecWheel.split(".");

    plugs = pplugs.split(".");
    rotor1Rotation = protor1Rotation
    rotor2Rotation = protor2Rotation
    rotor3Rotation = protor3Rotation
    rotor1RingSetting = protor1RingSetting
    rotor2RingSetting = protor2RingSetting
    rotor3RingSetting = protor3RingSetting
    connectionsReflector = pconnectionsReflector.split(".");
    turnOverNotches1 = pturnOverNotches1.split(".");
    turnOverNotches2 = pturnOverNotches2.split(".");
    doAnomaly = pdoAnomaly

    var output = "";

    for(var x = 0; x < string.length ; x++){
        output = output+encryptChar(string[x]);
    }


    Android.result(output);

}

 function encryptChar(k)
    {

        nextState()

        var x = (k.charCodeAt(0)) - 65;   //Cast to int and remove Unicode Offset (A=65 in Unicode.)
        //Encryption
        //forward direction
        x = encryptPlug(plugs,x);
        x = encryptForward(connectionsWheel,x);
        x = normalize(connectionsRotor1,x + rotor1Rotation - rotor1RingSetting);
        x = encryptForward(connectionsRotor1,x);
        x = normalize(connectionsRotor1,x - rotor1Rotation + rotor1RingSetting + rotor2Rotation - rotor2RingSetting);
        x = encryptForward(connectionsRotor2,x);
        x = normalize(connectionsRotor1,x - rotor2Rotation + rotor2RingSetting + rotor3Rotation - rotor3RingSetting);
        x = encryptForward(connectionsRotor3,x);
        x = normalize(connectionsRotor1,x - rotor3Rotation + rotor3RingSetting);
        //backward direction
        x = encryptForward(connectionsReflector,x);
        x = normalize(connectionsRotor1,x + rotor3Rotation - rotor3RingSetting);
        x = encryptBackward(revConnec3,connectionsRotor3,x);
        x = normalize(connectionsRotor1,x + rotor2Rotation - rotor2RingSetting - rotor3Rotation + rotor3RingSetting);
        x = encryptBackward(revConnec2,connectionsRotor2,x);
        x = normalize(connectionsRotor1,x + rotor1Rotation - rotor1RingSetting - rotor2Rotation + rotor2RingSetting);
        x = encryptBackward(revConnec1,connectionsRotor1,x);
        x = normalize(connectionsRotor1,x - rotor1Rotation + rotor1RingSetting);
        x = encryptBackward(revConnecWheel,connectionsWheel,x);
        x = encryptPlug(plugs,x);
        var ret = String.fromCharCode(x + 65);;     //Add Offset again, cast back to char and return

        return ret;

    }





function encryptPlug(plus,input)
{
    return parseInt(plugs[(input+plugs.length)%plugs.length]);
}

function normalize(connections,input)
{
    return parseInt((input+connections.length)%connections.length);
}

function encryptForward(connections,input)
{
    return parseInt(connections[normalize(connections,input)]);
}

function encryptBackward(reversedConnections,connections,input)
{
    return parseInt(reversedConnections[normalize(connections,input)]);
}

