function nextState()
    {
        rotor1Rotation = rotate(rotor1Rotation,connectionsRotor1);
        if (isAtTurnoverPosition(turnOverNotches1,rotor1Rotation) || doAnomaly)
        {
            rotor2Rotation = rotate(rotor2Rotation,connectionsRotor2);
            doAnomaly = doubleTurnAnomaly(turnOverNotches2,rotor2Rotation);
            if (isAtTurnoverPosition(turnOverNotches2,rotor2Rotation))
            {
                rotor3Rotation = rotate(rotor3Rotation,connectionsRotor3);
            }
        }
    }

function rotate(rotation,connections){

     return normalize(connections,rotation+1);

}

function isAtTurnoverPosition(turnOverNotches,rotation)
{
    for(var x = 0; x < turnOverNotches.length; x++)
    {
        if(turnOverNotches[x] == rotation) return true;
    }
    return false;
}

function doubleTurnAnomaly(turnOverNotches,rotation)
{
    for(var x = 0; x < turnOverNotches.length; x++)
    {
        if(rotation == turnOverNotches[x]-1) return true;
    }
    return false;
}

